INSERT INTO `cmf_posts` VALUES (6,1,'','','2016-04-13 16:18:54','<p><br/></p><p><span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);\">手机号码 可通过该手机号码快速找回密码中国大陆地区以外手机号码 点击这里 please enter the code you received 获取短信验证码</span></p>','账号和登录','',1,1,'2016-04-13 16:18:09','',0,0,'',0,'{\"thumb\":\"\"}',0,0,0,1,0,0),(7,1,'','','2016-04-13 16:45:30','<p>\r\n    <span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">用您的用户名登录，个人中心中会显示修改用户信息的选项，点击进入后，就可以在这里修改管理您的个人资料了，包括修改头像、性别、年龄、</span><span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">居住地、输入您需要填写的信息，点击“保存”，修改个人信息便完成了。</span>\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>','关于个人中心','',1,1,'2016-04-13 16:45:05','',0,0,'',0,'{\"thumb\":\"\"}',1,0,0,1,0,0),(8,1,'','','2017-03-04 15:06:17','<p>ceshi</p>','ceshi','',1,1,'2017-03-04 15:06:07',NULL,0,0,'',0,'{\"thumb\":\"\"}',1,0,0,1,0,0),(11,1,'','','2017-03-04 15:17:24','<p>主播协议</p>','主播协议','',1,1,'2017-03-04 15:17:18',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,1,0,0),(12,1,'','','2017-03-04 15:32:34','<p>11</p>','hehe','',1,1,'2017-03-04 15:32:21',NULL,0,0,'',0,'{\"thumb\":\"\"}',1,0,0,1,0,0),(13,1,'','','2017-03-04 15:45:16','<p>只是测试</p>','只是测试','',1,1,'2017-03-04 15:45:03',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(14,1,'','','2017-03-04 17:36:21','<p style=\"text-align: center;\"><img src=\"http://dsppojie.yunbaozhibo.com/data/upload/ueditor/20170601/592f7df43cea1.jpg\" title=\"timg.jpg\" alt=\"timg.jpg\"/></p><p><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px;\">娜扎助力“画出生命线”公益直播活动，为“芭莎救护车”项目筹集善款献爱心。作为直播首秀，娜扎表示很紧张，但因为是非常有意义的事情，可以帮助到贫困地区的百姓，所以很开心参与这样的公益活动。</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px;\"><img src=\"http://qiniudemo.yunbaozhibo.com/ueditor_20170601_592f80e55180e.jpg\" title=\"Img467338321.jpg\" alt=\"Img467338321.jpg\"/></span></p><p><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px;\"></span></p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">直播过程中，娜扎一边画出心目中的救护车，一边跟网友交流互动。扎着半丸子头搭配纯白衬衫的娜扎清爽干练，很多网友留言“娜扎太美啦，简单的搭配居然这么好看”。首次在直播间收到这么多礼物，娜扎十分感谢网友的支持与参与，表示获得的所有收益都将转化成真实的救护车，用于改善贫困地区百姓就医和急救条件。据了解，此次公益活动旨在向我国592个国定贫困县（乡）医院捐赠救护车，以待解决我国救护车“预派无车率”高、急救需求量大，现有救护车老化等现象。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">　　在此次公益活动中，娜扎不仅画出了心目中的救护车，还呼吁更多的人参与到慈善行列中，让爱的救护车驶向更多需要救助的地方。面对直播中带有攻击性的弹幕，娜扎也以自己的方式予以回应，直播金句频出，回答被赞机智霸气，比如“丑吗？丑也忍着看吧，因为这是有意义的事情，希望大家多做好事，帮助那些需要帮助的人”“黑粉，有黑粉吗？我非常爱我的黑粉，因为你们让我变得越来越强大”，心态越来越好的娜扎回应说做的是有意义的事情，即使有黑粉也不能停止。</p><p style=\"border: 0px; margin-top: 0px; margin-bottom: 0px; padding: 26px 0px 0px; font-size: 14px; font-family: 宋体, simsun, sans-serif, Arial; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">娜扎的善举也得到了许多网友的支持，表示跟着娜扎的脚步做公益很有意义。</p><p><span style=\"font-family: 宋体, simsun, sans-serif, Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255);\"><br/></span></p>','娜扎助力公益活动 直播首秀献爱心','',1,1,'2017-03-04 17:36:13',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(24,1,'','','2018-02-16 16:01:53','<p>问题问题问题问题问题问题问题</p><p><br/></p>','云豹','',1,1,'2018-02-16 16:01:24',NULL,0,NULL,'',0,'{\"thumb\":\"\"}',0,0,0,0,0,0),(17,1,'','','2017-06-01 11:08:53','<p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"></span><img src=\"http://qiniudemo.yunbaozhibo.com/ueditor_20170601_592f852b20743.jpg\" title=\"timg (6).jpg\" alt=\"timg (6).jpg\"/></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">多终端互通直播系统程序</h3><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\">云豹直播程序适合电脑、手机、微信等终端直播，并完成了各终端的互通。让用户的产品适合各类不同的终端用户群体需求。而且我们还根据不同用户的需求分出了两个不同版本的系统，传统的秀场模式系统和当下流行的手机全民直播系统为用户提供了产品可选性。</span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(98, 98, 98); font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; font-size: 14px; line-height: 24px; background-color: rgb(255, 255, 255);\"><img src=\"http://qiniudemo.yunbaozhibo.com/ueditor_20170601_592f88240acb6.jpg\" title=\"timg.jpg\" alt=\"timg.jpg\"/></span></p><p><br/></p><h3 style=\"font-size: 24px; margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; border: 0px; line-height: 36px; color: rgb(51, 51, 51); font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">直播与电商的完美结合</h3><p style=\"margin-top: 0px; margin-bottom: 0px; box-sizing: border-box; padding: 0px; border: 0px; color: rgb(98, 98, 98); font-size: 14px; line-height: 24px; font-family: &#39;Microsoft YaHei&#39;, arial, sans-serif; white-space: no